import { useContext, useState } from "react";
import SearchListInput from "./SearchListInput/SearchListInput";
import SearchListItem from "./SearchListItem/SearchListItem";
import ExpenseList from "../../../UI/ExpenseList/ExpenseList";
import ExpenseDataContext from "../../../../store/expenseData/expenseData--context";
import style from "./SearchList.module.css";

function SearchList() {
  const expenseDataCtx = useContext(ExpenseDataContext);
  const [expenseData, setExpenseData] = useState(expenseDataCtx.EXPENSE_DATA);

  return (
    <div className={style.search}>
      <SearchListInput />
      <ExpenseList data={expenseData} classItem={style.item} />
    </div>
  );
}

export default SearchList;
